import React from "react";

const ProgressBar = () => {


    return(
        <section className="progress_container" >
            <ul >
                <li >
                    <section className="progress">

                    </section>
                    <section className="parts">
                        <p>3</p>
                        <span>Payment</span>
                    </section>
                </li>
            </ul>
        </section>
    )
}
export default ProgressBar;
